import React from 'react'
import Background from './background/Background'
import { View, StyleSheet,Image,Text, Button } from 'react-native'

const Main = () => {
    return (
        <View style={styles.container}>
            <Background>
                <Image style={styles.weatherIcon} source={require('../../assets/storm.png')}></Image>
            </Background>
        </View>
    )
}

export default Main

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    weatherContainer: {
        backgroundColor: 'rgba(141, 141, 145,0.5)',
        height: '100px',
        width: '100px',

        // alignItems: 'center',
        // justifyContent: 'center',
    },
    weatherIcon:{
        height:'100px',
        width: '100px',
    }
})
